import React from 'react';
import { connect } from 'redux-bundler-react';
import Map from '../map/map-page'
import ToolBar from './toolbar'

class MainPage extends React.Component {
  render(){
    return (
      <div >
        <ToolBar/>
        <Map/>
      </div>
    )
  }
}
export default connect(
  MainPage
  );
